const Config = {
    serverUrl: 'http://localhost:9001/exchange/'
};
if (appType == 1) {
    Config.serverUrl = 'http://localhost:9001/exchange';
} else if (appType == 2) {
    Config.serverUrl = 'http://101.231.88.10:9191/';
}else if (appType == 3){
    Config.serverUrl = 'https://ding.microport.com:9091/';
}else {
    Config.serverUrl = 'http://mock/';
}
export default Config;
